      out.write("\t\t\t<P>\r\n");
      out.write("\t\t\t\t함께 사용하는 분들을 위해 KHCC를 이용하는 동안 흡연은 꼭 참아주세요! <br> 이용 후에는 차량 내부에 있는\r\n");
