      out.write("\t\t<p id=\"g1\">KHCC가이드</p>\r\n");
      out.write("\r\n");
      out.write("\t\t<div id=\"g2\">\r\n");
      out.write("\t\t\t<span id=\"gt\">KHCC는 차를 소유하는 사람보다 공유하는 사람들이 훨씬 더 많아지는 날을 꿈꿉니다!\r\n");
      out.write("\t\t\t</span><br>\r\n");
      out.write("\t\t\t<br> 물론 공유는 소유보다 불편할 때도 있습니다. 타인과 무엇을 나눠 쓴다는 것이 쉽지만은 않지요. <br>\r\n");
      out.write("\t\t\t하지만 KHCC는 이러한 불편과 거북함을 최소화시키기 위해 끊임없이 고민하려고 합니다. <br> 개인의 재화로\r\n");
      out.write("\t\t\t인식되었던 자동차를 사회적 재화로 바꾸고, 전체적인 사회적 비용을 낮추어 지역사회에 재투자되도록 노력하겠습니다. <br>\r\n");
      out.write("\t\t\t이용자의 편의를 최우선으로 합리적인 소비문화를 이끌어낼 수 있도록 노력하겠습니다.\r\n");
      out.write("\t\t</div>\r\n");
      out.write("\r\n");
      out.write("\t\t<div id=\"g3\">\r\n");
