      out.write("\t\t\t<p id=\"gt3\">카 쉐어링</p>\r\n");
      out.write("\t\t\t<ul id=\"gt33\">\r\n");
      out.write("\t\t\t\t<li>기존에 있던 카쉐어링보다 분단위 서비스로 인하여 유용함</li>\r\n");
      out.write("\t\t\t\t<li>원하는 차종을 선택하여 이용하는 만족감</li>\r\n");
      out.write("\t\t\t\t<li>믿고 결제할 수 있는 신뢰</li>\r\n");
      out.write("\t\t\t\t<li>급하게 필요할 때 쉽게 접할 수 있는 접근성</li>\r\n");
