      out.write("\r\n");
      out.write("\r\n");
      out.write("\t<!-- KHCC 임팩트 -->\r\n");
      out.write("\t<div id=show3>\r\n");
      out.write("\t\t<p id=\"g1\">KHCC임팩트</p>\r\n");
      out.write("\t\t<div id=\"g2\">\r\n");
      out.write("\t\t\t<span id=\"gt\">KHCC는 긍정적인 사회/환경적 영향을 고려하는 비즈니스 활동을 지향합니다.</span> <br>\r\n");
      out.write("\t\t\t합리적이고 대안적인 이동수단으로서 카쉐어링, 카풀 서비스를 제공하여, <br> 이로 인한 다양한 사회/환경적\r\n");
      out.write("\t\t\t파급효과를 지속적으로 관찰합니다.\r\n");
      out.write("\t\t</div>\r\n");
      out.write("\t\t<br> <br>\r\n");
      out.write("\t\t<div id=\"im1all\">\r\n");
      out.write("\t\t\t<img src=\"./resources/images/carrs.jpg\" id=\"img14\" />\r\n");
      out.write("\r\n");
      out.write("\t\t\t<div id=\"im\">\r\n");
      out.write("\t\t\t\t<p id=\"im1\">KHCC는 B Corp을 통해 기업의 사회/환경적 책임에 관한 글로벌 기준을 준수하고자\r\n");
      out.write("\t\t\t\t\t합니다.</p>\r\n");
      out.write("\t\t\t\tKHCC는 자원의 효율적 활용을 통해/환경적 문제를 효과적으로 헤결한다는 점에서 <br> 글로벌 인증을\r\n");
      out.write("\t\t\t\t획득했으며, 투명한 경영, 건강한 근로 환경 구축을 통해 지역사회 안에서 지속 가능하고<br> 긍정적인 영향을\r\n");
      out.write("\t\t\t\t끼칠 수 있는 기업문화를 확산해가고자 합니다. <br> <br>\r\n");
      out.write("\t\t\t\t<p id=\"im1\">카쉐어링,카풀 분야에서 세계 최초로 B corp</p>\r\n");
      out.write("\t\t\t\t<span id=\"im2\">글로버 사회적 기업 인증인 B Corp은 이윤 창출을 넘어 사회 환경적 임팩트를\r\n");
      out.write("\t\t\t\t\t추구하는 'Benefit Corporation'을 의미합니다.</span>\r\n");
      out.write("\t\t\t</div>\r\n");
      out.write("\t\t</div>\r\n");
      out.write("\r\n");
      out.write("\t\t<div id=\"im2all\">\r\n");
      out.write("\t\t\t<img src=\"./resources/images/carb.jpg\" id=\"img15\" />\r\n");
      out.write("\r\n");
      out.write("\t\t\t<div id=\"im22\">\r\n");
      out.write("\t\t\t\t<p id=\"imm2\">KHCC는 고객의 관점에서 서비스 가치를 극대화하기 위해 노력합니다.</p>\r\n");
      out.write("\t\t\t\tKHCC는 회원들의 즐거운 KHCC 라이프를 위하여, 안전을 최우선으로 서비스 만족을 위해 소비자중심경영 활동을 <br>\r\n");
